const https = require('https');
let information='';
const informationCountry=https.get('https://restcountries.com/v3.1/all',res=>{
    res.on('data',data =>{
        information += data;
        console.log(information);
    })
}).on('error',error => console.error(error.message));

console.log(informationCountry);
